import * as React from "react";
import styled from "styled-components";
import CategoryTab from "../components/CategoryTab";

import CategoriesData from "../../data/Categories";

interface CategorieProps {
  categoryPk: number;
  categoryCode: string;
  categoryName: string;
}
const Home: React.FC = () => {
  return (
    <Container>
      <Header>커뮤니티</Header>
      {CategoriesData.map((item: CategorieProps, idx: number) => {
        <CategoryTab key={idx} item={item} />;
      })}
    </Container>
  );
};

export default Home;

const Container = styled.div`
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;
const Header = styled.header`
  position: absolute;
  top: 34px;
  left: 30px;
  width: 81px;
  line-height: 32px;
  height: 32px;
  font-weight: 700;
  font-size: 22px;
`;
